INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIR', 'STOCK', 'AAR Corp.', 'NYQ', 'Industrials', 'Aerospace & Defense', 'AAR Corp. is a global aerospace and defense aftermarket solutions company with operations in over 20 countries. The Companys Parts Supply segment consists of its sales of used serviceable engine and airframe parts and components and distribution of new parts. The Repair & Engineering segment consists of its maintenance, repair, and overhaul (MRO) services across airframes and components. The Integrated Solutions segment consists of its fleet management and operations of customer-owned aircraft, customized performance-based supply chain logistics programs in support of the United States (U.S.) Department of Defense, U.S. Department of State, and foreign governments, flight hour component inventory and repair programs for commercial airlines, and integrated software solutions, including Trax. The Expeditionary Services segment consists of products and services supporting the movement of equipment and personnel by the U.S. and foreign governments and non-governmental organizations.', 'Wood Dale, IL, United States', 5600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNTA', 'STOCK', 'Centessa Pharmaceuticals plc', 'NMS', 'Healthcare', 'Biotechnology', 'Centessa Pharmaceuticals plc is a clinical-stage pharmaceutical company. The Company is developing a new class of potential therapies within its orexin receptor 2 (OX2R) agonist program for the treatment of excessive daytime sleepiness (EDS), impaired attention, cognitive deficits, fatigue and other symptoms across neurological, neurodegenerative and neuropsychiatric disorders. It also has an early-stage immuno-oncology program focused on its LockBody technology platform. Its OX2R agonist pipeline includes ORX750, its advanced OX2R agonist development candidate, and ORX142, ORX489 and OX2R agonists in preclinical development. Its ORX750, an investigational, orally administered, highly potent and selective OX2R agonist, is in a Phase IIa study of participants with narcolepsy type 1 (NT1), NT2 and idiopathic hypersomnia (IH). ORX142 is the second OX2R agonist development candidate being advanced for the treatment of neurological and neurodegenerative disorders and other symptoms.', 'Altrincham, , United Kingdom', 98);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DDL', 'STOCK', 'Dingdong (Cayman) Limited', 'NYQ', 'Consumer Defensive', 'Grocery Stores', 'Dingdong (Cayman) Ltd is a China-based e-commerce company. The Company offers groceries and other daily necessities directly delivered to users and households. The Companys groceries offerings include fresh produce, meat and seafood and other daily necessities. The Company procure its products primarily from direct upstream sources such as farms and cooperatives. The Companys frontline fulfillment grid consists of more than 950 frontline fulfillment stations across 29 cities in China. Its frontline fulfillment grid is also supported by approximately 40 regional processing centers to sort, package, label and store raw products prior to fulfillment.', 'Shanghai, , China', 3120);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARW', 'STOCK', 'Arrow Electronics, Inc.', 'NYQ', 'Technology', 'Electronics & Computer Distribution', 'A Arrow Electronics, Inc. Fontes e tecnologia de engenheiros para milhares de fabricantes, provedores de serviços e usuários de soluções de computação empresarial. Seus segmentos incluem componentes globais e ECS global. Ela distribui componentes eletrônicos para fabricantes de equipamentos originais e fornecedores de fabricantes de equipamentos por meio de seu segmento global de componentes e fornece soluções de computação empresarial para revendedores de valor agregado e provedores de serviços gerenciados por meio de seu segmento global de portáteis ECS. O portfólio global do ECS inclui soluções de datacenter, nuvem, segurança e análise. A Global ECS oferece suporte aos clientes, permitindo que seus negócios de software e soluções em nuvem sejam viabilizados por meio do ArrowSphere, uma plataforma de mercado e gerenciamento de software e nuvem. Mantém mais de 140 instalações de vendas e 36 centros de distribuição e valor agregado, atendendo mais de 85 países. Possui operações em cada', 'Centennial, CO, United States', 21520);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACIU', 'STOCK', 'AC Immune SA', 'NGM', 'Healthcare', 'Biotechnology', 'AC Immune SA is a Switzerland-based clinical-stage biopharmaceutical company. The Company focuses on precision medicine for neurodegenerative diseases. It designs, discovers and develops therapeutic, as well as diagnostic products for prevention, diagnosis and treatment of diseases caused by misfolding proteins. Its SupraAntigen and Morphomer technology platforms to create antibodies, small molecules and vaccines designed to address a broad range of neurodegenerative indications, such as Alzheimer''s disease (AD). The Company''s pipeline includes nine therapeutic product candidates with five in clinical trials, and three diagnostic candidates. Its lead product candidate is Crenezumab, a humanized and monoclonal anti-Abeta antibody for Alzheimers disease. It has collaborations with pharmaceutical companies, including Roche/Genentech, Eli Lilly, Biogen, Janssen Pharmaceuticals, Nestle Institute of Health Sciences, Life Molecular Imaging (formerly Piramal Imaging) and Essex Bio-Technolog', 'Lausanne, , Switzerland', 133);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRRR', 'STOCK', 'CoinShares Bitcoin ETF', 'NGM', NULL, NULL, 'In seeking to achieve its investment objective, the Trust will hold bitcoin and will value its Shares daily based on the value of bitcoin as reflected by the index, which is an independently calculated value based on an aggregation of executed trade flow of major bitcoin spot exchanges.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EHAB', 'STOCK', 'Enhabit, Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Enhabit, Inc. is a provider of home health and hospice services in the United States. Its segments include Home Health and Hospice. The Home Health segment provides a comprehensive range of Medicare-certified skilled home health services, including skilled nursing, physical, occupational and speech therapy, medical social work, and home health aide services. It works closely with patients, families, caregivers, and physicians to deliver data-driven, evidence-based care plans focused on patient needs and goals. Its home health services are provided by nurses, physical, occupational and speech therapists, medical social workers, and home health aides. The Hospice segment provides hospice services to terminally ill patients and their families. Hospice care focuses on the quality of life for patients experiencing an advanced, life- limiting illness by treating the symptoms of the disease, rather than the disease itself. It operates about 115 hospice agencies and 255 home health agencies.', 'Dallas, TX, United States', 10600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGEN', 'STOCK', 'Compugen Ltd.', 'NCM', 'Healthcare', 'Biotechnology', 'Compugen Ltd. is a therapeutic discovery company. The Company focuses on infrastructure to discover drug targets and develop therapeutics. The Company is engaged in the research, development and commercialization of therapeutic and product candidates. The Company''s pipeline primarily consists of early and preclinical stage immuno-oncology programs based on drug targets discovered by the Company, primarily immune checkpoint and myeloid protein target candidates. These programs are focused on the development of cancer immunotherapy drugs with potential to harness the immune system to provide treatment solutions in areas of unmet medical needs in various cancer types and patient populations, both as monotherapy and in combination with other drugs. Its pipeline also includes a preclinical stage fusion protein autoimmune product candidate. Its fields of focus are oncology and immunology, with emphasis on its discovery capabilities on immuno-oncology.', 'Holon, , Israel', 74);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AZ', 'STOCK', 'A2Z Cust2Mate Solutions Corp.', 'NCM', 'Technology', 'Software - Application', 'A2Z Cust2Mate Solutions Corp. is engaged in smart retail technology. The Company creates solutions for complex challenges. Its flagship product is the in-use mobile self-checkout shopping cart. With its user-friendly algorithm, touch screen, and other technologies, it streamlines the retail shopping experience by scanning purchased products and enabling in-cart payment so that customers can pick and go, and bypass long cashier checkout lines. Its in-cart solution also enables shoppers to use the cart as the point of sale by use of mobile payment applications, e-wallets and other financial services. Its Services segment includes maintenance services to the military, utilizing the application of advanced engineering capabilities as well as the development of related products for the civilian and retail markets. The Smart Carts segment includes retail automation solutions. The Precision Metal Parts segment is engaged in manufacturing and selling precision metal parts.', 'Vancouver, BC, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASTH', 'STOCK', 'Astrana Health, Inc.', 'NCM', 'Healthcare', 'Medical Care Facilities', 'Astrana Health, Inc. is a physician-centric, artificial intelligence (AI)-powered healthcare company focused on delivering patient-centered care. The Company provides care coordination services to each major constituent of the healthcare delivery system, including patients, families, primary care physicians, specialists, acute care hospitals, alternative sites of inpatient care, physician groups, and health plans. The Company''s segments include Care Partners, Care Delivery, and Care Enablement. Its Care Partners segment is focused on building and managing provider networks by partnering with, empowering, and investing in provider partners aligned on a shared vision for coordinated care delivery. Its Care Delivery organization includes primary care, multi-specialty care, and ancillary care services. Its Care Enablement segment represents a comprehensive platform that integrates clinical, operational, financial, and administrative information. It supports more than 20,000 providers.', 'Alhambra, CA, United States', 1900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COHU', 'STOCK', 'Cohu, Inc.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'Cohu, Inc. is engaged in supplying test, interface, automation, inspection and metrology, and software products and related services to the semiconductor industry. The Company sells its products, such as semiconductor automated test equipment (ATE), semiconductor handlers, interface products, inspection metrology, DI-Core data analytics, spares and kits and services. Its semiconductor ATE is used both for wafer level and device package testing. Its solutions consist primarily of two platforms for the system on a chip (SoC) device market: Diamondx tester and PAx tester. Interface Products are comprised of test contactors, probe heads and probe pins. Inspection Metrology are products that provide advanced vision capabilities. DI-Core data analytics is a comprehensive software suite used to optimize Cohu equipment performance. Spares and Kits are consumable, non-consumable and spare items. It provides various parts and labor warranties on its test and handling systems and instruments.', 'Poway, CA, United States', 2986);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSL', 'STOCK', 'Carlisle Companies Incorporated', 'NYQ', 'Industrials', 'Building Products & Equipment', 'Carlisle Companies Incorporated is a manufacturer and supplier of building envelope products and solutions that enable energy efficiency in buildings. Its segments include Carlisle Construction Materials (CCM) and Carlisle Weatherproofing Technologies (CWT). The CCM segment produces a complete line of energy-efficient single-ply roofing products and warranted roof systems and accessories for the commercial building industry, including ethylene propylene diene monomer (EPDM), thermoplastic polyolefin (TPO) and polyvinyl chloride (PVC) membrane, polyisocyanurate (polyiso) insulation, and engineered metal roofing and wall panel systems for commercial and residential buildings. CWT segment produces building envelope solutions that drive energy efficiency and sustainability in commercial and residential applications. Its products include waterproofing and moisture protection products, protective roofing underlayments, fully integrated liquid and sheet applied air/vapor barriers and others.', 'Scottsdale, AZ, United States', 5500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGTL', 'STOCK', 'Creative Global Technology Holdings Limited', 'NCM', 'Consumer Cyclical', 'Specialty Retail', 'Creative Global Technology Holdings Ltd is a holding company mainly engaged in sale of recycled and refurbished electronics. The Company is mainly engaged in the wholesale of recycled and refurbished electronics. The Company is also engaged in online retail business. In addition, the Company is engaged in the provision of rental services. The Company accepts a wide range of electronic devices for recycling, computers and laptops, mobile phones and tablets and electronic accessories.', 'Kwun Tong, , Hong Kong', 17);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AFG', 'STOCK', 'American Financial Group, Inc.', 'NYQ', 'Financial Services', 'Insurance - Property & Casualty', 'American Financial Group, Inc. is an insurance holding company. Through the operations of Great American Insurance Group, the Company is engaged primarily in property and casualty insurance, focusing on specialized commercial products for businesses. The Companys segments include property and casualty insurance and Other. The property and casualty insurance business includes specialty sub-segments: property and transportation, which includes physical damage and liability coverage for buses and trucks and other specialty transportation niches, inland and ocean marine, agricultural-related products and other commercial property coverage; specialty casualty, which includes primarily excess and surplus, executive and professional liability, general liability, umbrella and excess liability, and specialty financial, which includes risk management insurance programs for lending and leasing institutions, fidelity and surety products and trade credit insurance.', 'Cincinnati, OH, United States', 8700);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CIM', 'STOCK', 'Chimera Investment Corporation', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Chimera Investment Corporation is a real estate investment trust (REIT). The Company is engaged in the business of investing in a diversified portfolio of mortgage assets for itself and for unrelated third parties through its investment management and advisory services. The assets it may invest in and manage for others include residential mortgage loans, non-agency residential mortgage-backed securities (RMBS), agency RMBS, business purpose loans (BPLs) (including residential transition loans (RTLs)) and investor loans, mortgage servicing rights (MSRs) and other real estate-related assets such as Agency CMBS, junior liens and home equity lines of credit (HELOCs), equity appreciation rights, and reverse mortgages. The MBS and other real estate-related securities it purchases includes investment-grade, non-investment grade, and non-rated securities. The Company is focused on investing in commercial mortgage loans consisting of first or second lien loans secured by multifamily properties.', 'New York, NY, United States', 77);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DCGO', 'STOCK', 'DocGo Inc.', 'NCM', 'Healthcare', 'Medical Care Facilities', 'DocGo Inc. is a mobile healthcare services company that uses dispatch and communication technology to help provide mobile, in-person medical treatment directly to patients in the comfort of their homes, workplaces and other non-traditional locations and healthcare transportation in major metropolitan cities in the United States and the United Kingdom. The Companys offerings also include mobile phlebotomy lab services, which is engaged in addressing critical gaps in diagnostic care for underserved populations. The Mobile Health Services include a variety of healthcare services performed at homes, offices and other locations and event services, such as on-site healthcare support at sporting events and concerts. The Transportation Services encompass both emergency response and non-emergency transport services. Non-emergency transport services include ambulance transports and wheelchair transports.', 'New York, NY, United States', 3404);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSAC', 'STOCK', 'Banco Santander-Chile', 'NYQ', 'Financial Services', 'Banks - Regional', 'O Banco Santander-Chile (o Banco), anteriormente Banco Santander Chile, é um banco chileno. Os segmentos do Banco incluem banco de varejo, middle market, banco corporativo global e atividades corporativas (outros). O segmento de Banco de Varejo é composto por pessoas físicas e pequenas e médias empresas (PMEs). O segmento de Middle Market atende empresas e grandes corporações. O segmento de Banco Corporativo Global é composto por empresas multinacionais estrangeiras e nacionais. O segmento de Atividades Corporativas inclui sua Divisão de Gestão Financeira, que desenvolve funções de gestão global. Fornece uma gama de serviços bancários comerciais e de varejo a seus clientes, incluindo empréstimos denominados em pesos chilenos e em moeda estrangeira para financiar uma série de transações comerciais, comércio, contratos a termo de moeda estrangeira e linhas de crédito e uma gama de serviços bancários de varejo, incluindo financiamento hipotecário. Além das operações bancárias tradicionais', 'Santiago, , Chile', 8757);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKE', 'STOCK', 'The Buckle, Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'The Buckle, Inc. is a retailer of casual apparel, footwear, and accessories. The Company operates approximately 441 retail stores in 42 states. The Company markets a wide selection of casual apparel including denim, other casual bottoms, tops, sportswear, outerwear, accessories, and footwear. It also provides customer services, such as free hemming, free gift-packaging, easy layaways, the Buckle private label credit card, and a guest loyalty program. The Company offers denims from brands such as Flying Monkey, Hidden, KanCan, Levis, Miss Me, Rock Revival, Wrangler, and 7 For All Mankind. Its other key brands include Affliction, American Fighter, Ariat, Billabong, Birkenstock, Free People, Goorin Bros., Hey Dude, Hooey, Howitzer, Hurley, K. Swiss, Kimes Ranch, Lost Calf, Mia, Oakley, Old Row, Pendleton, Ray-Ban, Reebok, Ridge, RVCA, SOREL, Steve Madden, Sullen, Very G, White Crow, and Z Supply.', 'Kearney, NE, United States', 2800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DTCR', 'STOCK', 'Global X Data Center & Digital Infrastructure ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its total assets, plus borrowings for investments purposes, in the securities of the Solactive Data Center REITs & Digital Infrastructure Index and in ADRs and GDRs based on the securities in the index. The index is designed to provide exposure to companies that have business operations in the fields of data centers, cellular towers, and/or digital infrastructure hardware. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APAM', 'STOCK', 'Artisan Partners Asset Management Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Artisan Partners Asset Management Inc. is an investment management company. The Company is focused on attracting, retaining and developing talented investment professionals by creating an environment in which each investment team is provided resources and support, transparent and direct financial incentives, investment autonomy, and a long-term time horizon. It offers its investment management capabilities primarily to institutions and through intermediaries that operate with institutional-like decision-making processes by means of separate accounts and pooled vehicles. It accesses traditional institutional clients primarily through relationships with investment consultants. It accesses other institutional-like investors through consultants, alliances with defined contribution/401(k) platforms and relationships with financial advisors and broker-dealers. It offers clients a range of actively managed investment strategies diversified by asset class, market cap and investment style.', 'Milwaukee, WI, United States', 584);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DIN', 'STOCK', 'Dine Brands Global, Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'Dine Brands Global, Inc., together with its subsidiaries, owns and franchises the Applebees Neighborhood Grill + Bar (Applebees) concept in the American full-serve restaurant segment within the casual dining category of the restaurant industry. The Company also owns and franchises the International House of Pancakes (IHOP) concept in the midscale full-service restaurant segment within the family dining category of the restaurant industry and Fuzzys Taco Shop (Fuzzys) concept in the Mexican limited-service restaurant segment. Its segments include franchise operations, Rental operations, Financing operations and Company restaurant operations. The franchise operations segment consists of approximately 1,567 Applebees franchised restaurants; 1,824 IHOP franchised and area licensed restaurants, and 116 Fuzzy''s franchised restaurants. The Rental operations segment consists of lease or sublease agreements covering 554 IHOP franchised restaurants and two Applebees franchised restaurants', 'Pasadena, CA, United States', 992);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEIS', 'STOCK', 'Advanced Energy Industries, Inc.', 'NMS', 'Industrials', 'Electrical Equipment & Parts', 'Advanced Energy Industries, Inc. provides engineered, critical, precision power conversion, measurement, and control solutions to its customers. The Company designs, manufactures, sells, and supports precision power products that transform, refine, and modify the raw electrical power coming from either the utility or the building facility and convert it into various types of controllable, usable power that is predictable, repeatable, and customizable to meet the necessary requirements for powering a range of complex equipment. The Company''s precision power products and solutions are designed to enable new process technologies, improve productivity, and provide critical power capabilities for its customers. Its support services include warranty and non-warranty repair services, calibration, upgrades, and refurbishments of its products. The Companys products are sold in the Semiconductor Equipment, Industrial and Medical, Data Center Computing, and Telecom and Networking markets.', 'Denver, CO, United States', 10000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKNG', 'STOCK', 'Booking Holdings Inc.', 'NMS', 'Consumer Cyclical', 'Travel Services', 'A Booking Holdings Inc. É um fornecedor de reservas on-line de viagens e restaurantes e serviços relacionados. A empresa oferece seus serviços através de cinco principais marcas voltadas para o consumidor: Booking.com, Priceline, Agoda, KAYAK e OpenTable. Através de suas marcas, os consumidores podem reservar uma série de acomodações (incluindo hotéis, motéis, resorts, casas, apartamentos, etc.). alojamento e pequeno-almoço, pousadas e outras propriedades alternativas e tradicionais de alojamento) e um voo para os seus destinos; fazer uma reserva de aluguer de carro ou organizar um táxi do aeroporto; fazer uma reserva de jantar; ou reservar um pacote de férias, passeio, atividade ou cruzeiro. Os consumidores também podem usar seus serviços de meta-pesquisa para comparar facilmente informações de reservas de viagens, como reservas de voos, hotéis e aluguel de carros em centenas de plataformas de viagens online ao mesmo tempo. Booking.com oferece serviços de reserva de alojamento para ap', 'Norwalk, CT, United States', 24800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FCN', 'STOCK', 'FTI Consulting, Inc.', 'NYQ', 'Industrials', 'Consulting Services', 'FTI Consulting, Inc. is a global business advisory company. The Companys segment includes Corporate Finance & Restructuring segment focuses on the strategic, operational, financial, transactional and capital needs of its clients; Forensic and Litigation Consulting segment provides law firms, companies, government entities and other interested parties with a multidisciplinary and independent range of services in risk and investigations and disputes; Economic Consulting segment provides law firms, companies, and government entities with analyzes of economic issues for use in international arbitration and legal and regulatory proceedings and strategic decision-making and public policy debates; Technology segment provides companies, law firms, private equity firms and government entities with a portfolio of digital insights and risk management consulting and data services, and Strategic Communications segment provides corporate reputation, financial communications and public affairs.', 'Washington, DC, United States', 7907);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGRO', 'STOCK', 'Adecoagro S.A.', 'NYQ', 'Consumer Defensive', 'Farm Products', 'Adecoagro S.A. is a holding company. The Company is involved in a range of businesses, including farming crops and other agricultural products, dairy operations, sugar, ethanol and energy production and land transformation. The Company is organized into three main lines of business: farming; land transformation, and sugar, ethanol and energy. Its agricultural activities consist of harvesting certain agricultural products, including crops, rough rice and sugarcane, for sale to third parties and for internal use as inputs in its various manufacturing processes, and producing raw milk. Its manufacturing activities consist of selling manufactured products, including processed rice, sugar, ethanol and energy, among others, and providing services, such as grain warehousing and conditioning and handling and drying services, among others. The Company''s land transformation activities consist of the acquisition of farmlands or businesses with underdeveloped or underutilized agricultural land.', 'Luxembourg, , Luxembourg', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRCT', 'STOCK', 'Cricut, Inc.', 'NMS', 'Technology', 'Computer Hardware', 'Cricut, Inc. is a creative technology company. The Company has designed and built an ecosystem of connected cutting machines, accessories, and materials for scalability and seamless integration, allowing it to introduce new products as well as continuously update the existing physical and digital products. Its segments include Platform and Products. Its Circuit platform centers around its cloud-based application, Cricut Design Space, giving users access to create and work on their projects anywhere, at any time, across desktop and mobile devices. Cricut hardware and design software work together as a connected platform for consumers to perform do-it-yourself (DIY) projects quickly and easily. These products include a flagship line of smart cutting machines such as the Cricut Maker series, the Cricut Explore series, and Cricut Joy series, and Cricut Venture series, accompanied by other tools like Cricut EasyPress, the Infusible Ink system, and a diverse collection of materials.', 'South Jordan, UT, United States', 640);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BZFD', 'STOCK', 'BuzzFeed, Inc.', 'NCM', 'Communication Services', 'Internet Content & Information', 'BuzzFeed, Inc. is a digital media company. Across entertainment, news, food, pop culture, and commerce, its brands drive conversation and inspire what audiences watch, read, and buy. Its brands include BuzzFeed, HuffPost, and Tasty. Its flagship BuzzFeed brand curates entertainment content, pop culture, and the Internet. With articles, lists, quizzes, videos, and original series, its audience comes to BuzzFeed to learn what to watch, read, and buy. HuffPost is a global media platform for news, politics, opinion, entertainment, features, and lifestyle content. Tasty is a pioneering overhead video format that is ubiquitous across food brands and is a platform for food creators. It provides its advertising customers with an array of offerings, including display, programming, and video advertising inventory to target users on its owned and operated sites, applications, and third-party platforms. Its customer base consists of United States-based and global corporations.', 'New York, NY, United States', 611);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DSU', 'STOCK', 'BlackRock Debt Strategies Fund, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Debt Strategies Fund, Inc. is a closed ended fixed income mutual fund launched by BlackRock, Inc. The fund is managed by BlackRock Advisors, LLC. It invests in fixed income markets of the United States. The fund primarily invests in a diversified portfolio of companies'' debt instruments, including corporate loans, which are rated in the lower rating categories of the established rating services (BBB or lower by S&P''s or Baa or lower by Moody''s) or unrated debt instruments, which are in the judgment of the investment adviser of equivalent quality. It was formerly known as Debt Strategies Fund Inc. BlackRock Debt Strategies Fund, Inc. was formed on March 27, 1998 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCS', 'STOCK', 'Century Communities, Inc.', 'NYQ', 'Real Estate', 'Real Estate - Development', 'Century Communities, Inc. is a homebuilder that specializes in online home sales. It develops, designs, constructs, markets and sells single-family attached and detached homes. In addition to building homes, it entitles and develops the underlying land. It builds and sells homes under its Century Communities and Century Complete brands. Its Century Communities brand is focused on serving the affordable homebuilding market but offers a range of buyer profiles including entry-level, first and second time move-up, and lifestyle homebuyers, and provides its homebuyers with the ability to personalize their homes through certain option and upgrade selections. Its Century Complete brand targets entry-level homebuyers, primarily sells homes through retail studios and the Internet, and generally provides no option or upgrade opportunities. It offers title, insurance and lending services in select markets through its Parkway Title, IHL Home Insurance Agency, and Inspire Home Loans subsidiaries.', 'Greenwood Village, CO, United States', 1873);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARKO', 'STOCK', 'Arko Corp.', 'NCM', 'Consumer Cyclical', 'Specialty Retail', 'Arko Corp. is operators of convenience stores and wholesalers of fuel in the United States. The Company operates through four segments: Retail Segment, Wholesale Segment, Fleet Fueling Segment, and GPMP Segment. The Retail segment includes the operation of a chain of retail stores, which includes convenience stores selling fuel products and other merchandise to retail customers. The Wholesale segment supplies fuel to dealers, on either a consignment or cost-plus basis. The Fleet Fueling segment includes the operation of proprietary and third-party cardlock locations, and issuance of proprietary fuel cards that provide customers access to a nationwide network of fueling sites. The GPMP segment includes the operations of GPM Petroleum LP (GPMP), which primarily sells and supplies fuel to GPM Investments, LLC (GPM). It operates its stores under more than 25 regional store brands, including 1-Stop, Admiral, Apple Market, BreadBox, Corner Mart, Handy Mart, Jetz, Jiffi Stop, and others.', 'Richmond, VA, United States', 11772);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSAI', 'STOCK', 'Cloudastructure Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'Cloudastructure Inc. is engaged in providing artificial intelligence (AI) video surveillance and remote guarding service built on AI and machine learning platforms. The Companys solutions include AI Surveillance, Remote Guarding, and Mobile Surveillance. Its AI video surveillance solution include seamless video monitoring software and live monitoring services for end-to-end security. Its Mobile Surveillance Trailer offers durable hardware and software for end-to-end security. The Companys solutions centralize the management of video surveillance in a collection of servers that host its software and infrastructure and can be accessed over the internet. Its products include Cloud Video Surveillance, Remote Guards, Cloud Video Recorder (CVR), and Cameras and Speakers. The Companys cloud-based solutions allow its customers to provide real-time safety and security solutions for their properties, as well as manages security across all of their locations.', 'Palo Alto, CA, United States', 16);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACEL', 'STOCK', 'Accel Entertainment, Inc.', 'NYQ', 'Consumer Cyclical', 'Gambling', 'Accel Entertainment, Inc. is a distributed gaming operator in the United States and a partner for local business owners in the markets it serves. The Company offers turnkey full-service gaming solutions to authorized non-casino locations such as bars, restaurants, convenience stores, truck stops, and fraternal and veteran establishments across the country. It installs, maintains, operates and services gaming terminals and related equipment for its location partners as well as redemption devices, stand-alone automated teller machines (ATMs) and amusement devices, including jukeboxes, dartboards, pool tables, and other entertainment-related equipment. It also designs and manufactures gaming terminals and related equipment. Its segments include distributed gaming and casinos and racing. The Company offers amusement devices, including jukeboxes, dartboards, pool tables, and other entertainment-related equipment that enhance customer experience and engagement.', 'Burr Ridge, IL, United States', 1500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCB', 'STOCK', 'Coastal Financial Corporation', 'NMS', 'Financial Services', 'Banks - Regional', 'Coastal Financial Corporation is a bank holding company, whose wholly owned subsidiaries are Coastal Community Bank (Bank) and Arlington Olympic LLC (LLC). The Company operates through three segments: the community bank, CCBX and treasury & administration. The community bank segment includes all community banking activities, with a primary focus on providing a wide range of banking products and services to consumers and small to medium-sized businesses in the broader Puget Sound region in the state of Washington and through the Internet and its mobile banking application. The CCBX segment provides banking as a service (BaaS) that allows its broker-dealer and digital financial service partners to offer their customers banking services. The treasury & administration segment includes investments, debt and other reporting items that are not specific to the community bank or CCBX segments. It operates about 14 full-service banking locations, 12 of which are located in Snohomish County.', 'Everett, WA, United States', 488);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATNM', 'STOCK', 'Actinium Pharmaceuticals, Inc.', 'ASE', 'Healthcare', 'Biotechnology', 'Actinium Pharmaceuticals, Inc. specializes in the development of targeted radiotherapies. The Company is advancing its lead product candidate Actimab-A, a CD33 targeting therapeutic, as potential backbone therapy in acute myeloid leukemia (AML) and other myeloid malignancies leveraging the mutation agnostic alpha-emitter radioisotope payload Actinium-225 (Ac-225). The Company is engaged with the National Cancer Institute (NCI) under the Cooperative Research and Development Agreement (CRADA) for development of Actimab-A in AML and other myeloid malignancies. ATNM-400 is the Company''s novel non-PSMA targeting Ac-225 radiotherapy for prostate cancer. Iomab-ACT, its conditioning candidate, is being developed to improve patient access and outcomes for potentially curative cell and gene therapies. Its Iomab-B program is an induction and conditioning agent prior to bone marrow transplant in patients with r/r AML, which it is seeking a potential strategic partner for the United States.', 'New York, NY, United States', 27);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPOP', 'STOCK', 'Pop Culture Group Co., Ltd', 'NCM', 'Communication Services', 'Entertainment', 'Pop Culture Group Co Ltd is a China-based holding company focused on developing and hosting hip-hop events. The Company is also engaged in hosting entertainment events as well as providing event planning, execution services and marketing services to corporate clients. The Company owns the rights to a portfolio of hip-hop events, including stage plays, dance competitions, cultural and musical festivals, karaoke promotion parties, and hosts various concerts. The Company provides marketing services, including brand promotion services, such as trademark and logo design, visual identity system design, brand positioning, brand personality, digital solutions, and other services, which includes advertisement distribution.', 'Xiamen, , China', 26);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRKL', 'STOCK', 'Brookline Bancorp, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Brookline Bancorp, Inc. is a bank holding company for Brookline Bank, Bank Rhode Island (BankRI), PCSB Bank (the Bank), and Clarendon Private. The Bank offers a range of commercial, business and retail banking services, including a full complement of cash management products, online banking services, and consumer and residential loans and investment services, designed to meet the financial needs of small-to mid-sized businesses and individuals throughout Central New England and the Lower Hudson Valley in New York. Its specialty lending activities, including equipment financing, are focused on the New York and New Jersey metropolitan area, with services offered throughout the United States. Its loan portfolio consists primarily of first mortgage loans secured by commercial, multifamily and residential real estate properties located in the Company''s primary lending area, loans to business entities, including commercial lines of credit, and loans to condominium associations.', 'Boston, MA, United States', 951);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRSR', 'STOCK', 'Corsair Gaming, Inc.', 'NMS', 'Technology', 'Computer Hardware', 'Corsair Gaming Inc. is a global developer and manufacturer of high-performance products and technology for gamers, content creators, and personal computer (PC) enthusiasts. The Companys segments include Gamer and Creator Peripherals and Gaming Components and Systems. The Gamer and Creator Peripherals segment includes its high-performance gaming keyboards, mice, headsets, controllers, and streaming products, which include capture cards, Stream Decks, microphones and audio interfaces, its Facecam streaming cameras, studio accessories, sim racing products, and gaming furniture, among others. The Gaming Components and Systems segment includes high-performance power supply units (PSUs), cooling solutions, computer cases, and dynamic random-access memory (DRAM) modules, as well as high-end prebuilt and custom-built gaming PCs and laptops, and gaming monitors, among others. Its two proprietary software platforms include iCUE for gamers and Elgato streaming suite for content creators.', 'Milpitas, CA, United States', 2567);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('KAVL', 'STOCK', 'Kaival Brands Innovations Group, Inc.', 'NCM', 'Consumer Defensive', 'Tobacco', 'Kaival Brands Innovations Group, Inc. is engaged in the sale, marketing and distribution of electronic nicotine delivery system (ENDS) products, also known as e-cigarettes, in a variety of favors. The Company operates through an international licensing agreement with Philip Morris Products S.A. (PMPSA), a wholly owned affiliate of Philip Morris International Inc. (PMI). Its patent portfolio consists of approximately 19 existing and 47 pending with technologies related to vaporization and inhalation technologies. Its trademarks include KAIVAL BRANDS and KAIVAL LABS.', 'Grant-Valkaria, FL, United States', 3);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALVO', 'STOCK', 'Alvotech', 'NGM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Alvotech SA is a biotechnology company. The Company is focused on the development and manufacture of biosimilar medicines for patients globally. It is engaged in developing a pipeline of monoclonal antibodies that target a variety of therapeutic areas including inflammatory diseases, oncology, and ophthalmology. The Companys pipeline contains eight biosimilar candidates aimed at treating autoimmune disorders, eye disorders, osteoporosis, respiratory disease, and cancer. Its products pipeline includes AVT02, AVT04, AVT23, AVT03, AVT05, AVT06, AVT16, and AVT33. Its AVT02 is a monoclonal antibody and a biosimilar to Humira (adalimumab). AVT04 is a monoclonal antibody and a biosimilar candidate to Stelara (ustekinumab). It has formed a network of strategic commercial partnerships to provide global reach and leverage expertise in markets that include the United States (U.S.), Europe, Japan, China, and other Asian countries and large parts of South America, Africa, and the Middle East.', 'Luxembourg, , Luxembourg', 1012);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARDT', 'STOCK', 'Ardent Health, Inc.', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Ardent Health, Inc., formerly Ardent Health Partners, Inc., is a provider of healthcare in mid-sized urban communities across the United States. Through its subsidiaries, the Company delivers care through a system of 30 acute care hospitals and approximately 280 sites of care with over 1,800 affiliated providers across six states. It provides both general and specialty services, including internal medicine, general surgery, cardiology, oncology, orthopedics, womens services, neurology, urology, and emergency services, within inpatient and ambulatory care settings. In addition to its 30 acute care hospitals, it operates a network of ambulatory facilities and telehealth services, including primary care and specialty care clinics, ambulatory surgery centers (ASCs), urgent care centers, free-standing emergency departments, and diagnostic imaging centers. It operates a consumer-centric healthcare platform focused on creating relationships with its patients across multiple care settings.', 'Brentwood, TN, United States', 19200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NXJ', 'STOCK', 'Nuveen New Jersey Quality Municipal Income Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Nuveen New Jersey Quality Municipal Income Fund is a closed ended fixed income mutual fund launched by Nuveen Investments, Inc. The fund is co-managed by Nuveen Fund Advisors LLC and Nuveen Asset Management, LLC. It invests in the fixed income markets of New Jersey. The fund invests in undervalued municipal securities and other related investments that are, exempt from regular federal and New Jersey income taxes that are rated Baa or BBB or better. It employs fundamental analysis with bottom-up stock picking approach to create its portfolio. The fund benchmarks the performance of its portfolio against the Standard & Poor''s (S&P) New Jersey Municipal Bond Index. The fund was formerly known as Nuveen New Jersey Dividend Advantage Municipal Fund. Nuveen New Jersey Quality Municipal Income Fund was formed on June 1, 1999 and is domiciled in the United States.', 'Chicago, IL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FBIO', 'STOCK', 'Fortress Biotech, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Fortress Biotech, Inc. is a biopharmaceutical company focused on acquiring and advancing assets. The Company has eight marketed prescription pharmaceutical products and over 20 programs in development, with its majority-owned and majority-controlled partners and subsidiaries and partners and subsidiaries it founded and in which it holds significant minority ownership positions. Its portfolio is being commercialized and developed for various therapeutic areas, including oncology, dermatology, and rare diseases. Its dermatology products include Emrosi, Qbrexza, Amzeeq, Zilxi, Exelderm, Targadox, and Luxamend. Its late-stage product candidates include CUTX-101 (copper histidinate injection for Menkes disease), Triplex (cytomegalovirus (CMV) vaccine), and CAEL-101 (monoclonal antibody for AL amyloidosis). Its early and mid-stage product candidates include Dotinurad (urate transporter (URAT1) inhibitor for gout), MB-101 (IL13R?2 CAR T Cell Program for Glioblastoma), and others.', 'Bay Harbor Islands, FL, United States', 101);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DXPE', 'STOCK', 'DXP Enterprises, Inc.', 'NMS', 'Industrials', 'Industrial Distribution', 'DXP Enterprises, Inc. is a products and service distributor that offers solutions to industrial customers throughout the United States, Canada, Mexico and the United Arab Emirates. It provides pumping solutions, supply chain services and maintenance, repair, operating and production (MROP) services. Its segments include Service Centers (SC), Innovative Pumping Solutions (IPS), and Supply Chain Services (SCS). SC segment is engaged in providing maintenance, repair and operating (MRO) products, equipment and integrated services, including logistics capabilities, to industrial customers. IPS segment fabricates and assembles custom-made pump packages, re-manufactures pumps, manufactures branded private label pumps, and provides products and process lines for the water and wastewater treatment industries. SCS segment provides a range of MRO products and manages all or part of a customer''s supply chain, including warehouse and inventory management.', 'Houston, TX, United States', 3028);\n